DROP TABLE IF EXISTS `tp_advert`;
CREATE TABLE `tp_advert` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '推广商名称',
  `type` int(3) DEFAULT NULL COMMENT '广告类型，1:启动图广告，2:视频广告,3:弹窗霸屏广告,4:首页四屏广告',
  `img` varchar(255) DEFAULT NULL COMMENT '广告图片',
  `url` varchar(255) DEFAULT NULL COMMENT '广告视频播放地址',
  `open_type` varchar(255) DEFAULT NULL COMMENT '打开方式：1：直接下载，2：浏览器打开',
