  `end_time` datetime DEFAULT NULL COMMENT '到期时间',
  `ad_url` varchar(255) DEFAULT NULL COMMENT '广告跳转/下载链接',
  `title` varchar(255) DEFAULT NULL COMMENT '广告标题',
  `view_count` bigint(255) DEFAULT '0' COMMENT '浏览次数，可做显示那条广告的依据',
  `state` int(11) DEFAULT NULL COMMENT '广告状态 0 禁用， 1 启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

